function clicking(ElementId) {
  const elementArr = [
    "overview-btn",
    "course-struct-btn",
    "documents-btn",
    "dissertation-btn",
    "attend-btn",
    "carrer-btn",
  ];
  const focusedClassName = "college-buttons-focused";
  const unfocusedClassName = "college-button";
  for (let element of elementArr) {
    if (element === ElementId) {
      document.getElementById(element).classList.remove(unfocusedClassName);
      document.getElementById(element).classList.add(focusedClassName);
    } else {
      document.getElementById(element).classList.add(unfocusedClassName);
      document.getElementById(element).classList.remove(focusedClassName);
    }
  }
}

